import './App.css';


export default function Home(){
 
      return (
        <div className="card">
          <div className="card__body">
         
          <h2 className="card__title">Add Me</h2>
          <p className="card__description">Hello Iam a card!</p>
        </div>
        <button className="card__btn">View Recipe</button>
        </div>
      )
    }
